import './App.scss';
import FrontPage from './components/FrontPage'
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

function App() {
  return (
        <div>
          <Router>
            <Routes>
            </Routes>
            <Route path="bruh" element={<FrontPage />} />
          </Router>
        </div>

  )
}

export default App;
